              <li>
                <a href="" id="blog">
                  BLOG
                </a>
              </li>
              <li>
                <a href="">ABOUT</a>
              </li>
              <li>
                <a href="">LINK</a>
              </li>
              <li>
                <a href="">PROJECTS</a>
              </li>
            </ul>
          </div>
        </div>
      </header>


    </div>
  );
}

export default App;
